import React from 'react';
import './Results.css';

const Results = ({ scores, answers }) => {
    const { stress, anxiety, depression } = scores;
    const threshold = 5; // Define a threshold value based on your criteria

    // Function to analyze answers and provide insights
    const analyzeAnswers = () => {
        // Example analysis logic
        let score = 0;
        Object.values(answers).forEach(answer => {
            // Increment score based on answers (adjust logic as needed)
            score += answer ? 1 : 0;
        });

        // Return insights based on the calculated score
        if (score > threshold) {
            return "You seem to be coping well!";
        } else {
            return "Consider reaching out to a mental health professional.";
        }
    };

    // Function to get the result message based on score value
    const getResultMessage = (score) => {
        if (score > 5) {
            return "High";
        } else if (score > 2) {
            return "Moderate";
        } else {
            return "Low";
        }
    };

    return (
        <div className="results-container">
            <h2>Your Mental Health Results</h2>
            <p>Stress Level: {getResultMessage(stress)}</p>
            <p>Anxiety Level: {getResultMessage(anxiety)}</p>
            <p>Depression Level: {getResultMessage(depression)}</p>

            {/* Display analysis based on answers */}
            <p>{analyzeAnswers()}</p>

            <p>
                <strong>Note:</strong> If you feel that you need immediate help, please contact a mental health professional.
            </p>
        </div>
    );
};

export default Results;
